The entire outlast series is just phenomenal in that aspect.

Terryfying and unsettling to the point that you actually get tired of the game.

 @Syokool  Mad respect. Thank you for your service and all that you do. You may or may not be lying, but that’s not what matters. Your brief description helped me vividly imagine the scenes that you described, although I’m certain that what I imagined wasn’t even 1/10th of what you saw with your own two eyes.  

Once again, I’m really thankful for you and the others, who help shed light and expose these kind of things. They hardly get covered on the internet, but I’m sure they happen everywhere, perhaps even as I’m typing this message. 

Unfortunately, there’s always a bad if there’s ever a good. After all, you can never distinguish light if you never experienced darkness. It’s truly saddening that these things happen, but that’s the harsh reality. On a last note, I’d like to thank you once again for your work. Stay safe.

